"use strict";

function f_gold(sentence, discount) {
    let ans = [];
    for (let w of sentence.split(" ")) {
        if (w[0] === "$" && /^\d+$/.test(w.slice(1))) {
            let t = parseInt(w.slice(1)) * (1 - discount / 100);
            ans.push("$" + t.toFixed(2));
        } else {
            ans.push(w);
        }
    }
    return ans.join(" ");
}
